def MostFrequentChar(string):
    dictionary = {}
    for char in string:
        if char not in dictionary:
            dictionary[char] += 1
        else:
            dictionary[char] = 1
    values = list(dictionary.values())
    keys = list(dictionary.keys())
    return keys[values.index(max(values))]

